import Navbar from "./Navbar";
import Head from "next/head";

const Layout = (props) => {
  return (
    <div>
      <Head>
        <title>My Next app</title>
        <link
          rel="stylesheet"
          href="https://bootswatch.com/cerulean/bootstrap.min.css"
        />
      </Head>
      <Navbar />
      {props.children}
    </div>
  );
};

export default Layout;
